import React from 'react';
import { Button, Typography, Container, Box} from '@material-ui/core';
import Table from "./table";
import { Banner, StaticBanner } from 'material-ui-banner';

function App() {
  return (

  <Container maxWidth="sm"><AppBar>

</AppBar>

<StaticBanner />

      <Typography variant="h3" gutterBottom>
        MyApp
      </Typography>
      <Button color="primary" variant="contained">BUTTON</Button>
      <Box mt={3}>
        <Table />
      </Box>
   </Container>
  )
}

export default App;
